import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './Login.js'

function App() {
  return (
    <Router>
      <div className="App">
        <div className="content">
          <Switch>
            <Route exact path="/login">
              <Login />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
